ems makes inventory management easy. Subscribe to Square Marketing and easily send email promotions to your customers using the contact information.\" list_item_1=\"Orders go right to your restaurant point of sale, KDS, and kitchen\" list_item_url_1=\"#\" list_item_2=\"Provide in-person pickup, & delivery by professional couriers\" list_item_url_2=\"#\" list_item_3=\"Offer in-person diners self-serve, contactless ordering via QR codes.\" list_item_url_3=\"#\" enable_lazy_loading=\"yes\"][/about][team title=\"Meet With Team\" subtitle=\"Team\" team_ids=\"1,2,3,4\"][/team][features quantity=\"2\" title_1=\"Solutions that work together\" subtitle_1=\"Features #01\" description_1=\"Publish your eCommerce site quickly with our easy-to-use store builder— no coding required. Migrate your items from your point of sale system or turn your Instagram feed into a shopping site and start selling fast. Square Online works for all kinds of businesses—retail, restaurants, services.\" image_1=\"banners/about-banner-1.jpg\" button_label_1=\"Get In Touch\" button_url_1=\"#\" title_2=\"All kinds of payments securely\" subtitle_2=\"Features #02\" description_2=\"Publish your eCommerce site quickly with our easy-to-use store builder— no coding required. Migrate your items from your point of sale system or turn your Instagram feed into a shopping site and start selling fast. Square Online works for all kinds of businesses—retail, restaurants, services.\" image_2=\"banners/about-banner-2.jpg\" button_label_2=\"Contact With Us\" button_url_2=\"#\" enable_lazy_loading=\"yes\"][/features]',1,NULL,'default',NULL,'published','2025-05-20 14:06:55','2025-05-20 14:06:55'),(8,'Contact','[contact-box title=\"Get In Touch\" address=\"24/26 Strait Bargate, Boston, PE21, United Kingdom\" phone=\" +098 (905) 786 897 8\" email=\"ninico@example.com\" hours=\"10 am - 10 pm EST, 7 days a week\" show_contact_form=\"1\" button_label_1=\"Get Support On Call\" button_url_1=\"#\" button_icon_1=\"fa fa-headphones